import React from 'react';

import Sidebar from 'react-sidebar';
import {NavItem} from 'react-bootstrap';
import SidebarToggle from '../Sidebar/SidebarToggle/SidebarToggle';

const sidebar = (props) => {
    return (
        <Sidebar
          sidebar={
              <>
            <NavItem>item 1</NavItem>
            <NavItem>item 1</NavItem>
            </>
            }
          open={props.open}
        //   onSetOpen={}
          styles={sidebar}
        >
        <SidebarToggle />
        </Sidebar>
      );
};

export default sidebar;
